export default function Admin() {
  return (
      <div className="container">
        <div className="header">Admin</div>
        <div className="content_box">form</div>
    <style jsx>{`
        body{
            margin:0px;
            padding:0px;
            width:100%; 
            height:100%;
        }
        .container{
            height:100%;
        }
        .header{
            height:28px;
            padding:8px;
            background-color:#006; 
            color:#FFF;
	        line-height:28px;
        }
        .content_box{
            height:calc(100% - 60px);
            padding:8px;
        }
    `}</style>
      </div>
  );
}
